import getData from "@/pages/trade/navbar/components/data.json";
import AuthenticationService from "@/services/AuthenticationService";
import moment from "moment";
export default {
  data: function data() {
    return {
      unreadNotifications: []
    };
  },
  methods: {
    getHMS: function getHMS(value) {
      if (value) {
        var now = moment(value).fromNow();
        return now;
      }
    }
  },
  mounted: function mounted() {
    var _this = this;

    var obj = {
      e: getData.email
    };
    AuthenticationService.getListNotifi(obj).then(function (res) {
      _this.$vs.loading.close("#loading-corners > .con-vs-loading");

      if (res.data.success) {
        var dataN = res.data.data;

        for (var i = 0; i < dataN.length; i++) {
          var json = {
            index: i,
            title: dataN[i].title,
            msg: dataN[i].content,
            views: dataN[i].views,
            time: _this.getHMS(dataN[i].created_at)
          };

          _this.unreadNotifications.push(json);
        }
      }
    });
  }
};
